# 1 "fmtnasm.mll"
 
  let col = ref 1

  let program = ref ""

  let string_buffer = Buffer.create 1024

  let process_label = fun s ->
    let size = String.length s in
    col := !col + size;
    program := !program ^ s

  let process_instruction = fun s ->
    let size = String.length s in
    for i = !col to 16 do
      incr col;
      program := !program ^ " "
    done;
    col := !col + size;
    program := !program ^ s

  let process_operand = fun s ->
    for i = !col to 26 do
      incr col;
      program := !program ^ " "
    done;
    let size = String.length s in
    col := !col + size;
    program := !program ^ s

  let process_comment =
    fun s ->
      let size = String.length s in
      if !col = 1 then
        begin
          col := !col + size;
          program := !program ^ s
        end
      else
        begin
          for i = !col to 80 do
            incr col;
            program := !program ^ " "
          done;
          col := !col + size;
          program := !program ^ s
        end

